"use strict";(self.webpackChunkdocs_fintesk_com=self.webpackChunkdocs_fintesk_com||[]).push([[1281],{983:e=>{e.exports=JSON.parse('{"tag":{"label":"Basic concepts","permalink":"/tags/basic-concepts","allTagsPath":"/tags","count":8,"items":[{"id":"kb/getting-started/search-finding-what-you-need","title":"Finding what you need","description":"The search bar in Fintesk allows you to quickly find and access any deals, contacts, activities and products in your Fintesk account.","permalink":"/kb/getting-started/search-finding-what-you-need"},{"id":"kb/getting-started/fintesk-glossary","title":"Fintesk glossary","description":"When using Fintesk or navigating the many help guides in the Knowledge Base, you may come across terms you are unfamiliar with or desire clarification on. In those cases, our glossary might prove very helpful!","permalink":"/kb/getting-started/fintesk-glossary"},{"id":"kb/getting-started/interface-in-fintesk","title":"Fintesk interface","description":"The interface is the place where you can interact with the Fintesk software and keep track of your sales and data. As a busy salesperson, you may need to quickly move around in the Fintesk app to find the information that is most relevant to you.","permalink":"/kb/getting-started/interface-in-fintesk"},{"id":"kb/getting-started/fintesk-user-vs-company-account","title":"Fintesk user vs. company account","description":"When a Fintesk account is created, both a user account and a company account are created.","permalink":"/kb/getting-started/fintesk-user-vs-company-account"},{"id":"kb/getting-started/how-can-i-delete-items-in-fintesk","title":"How can I delete items in Fintesk?","description":"Depending on the situation, you may need to delete items in Fintesk in many different ways. We\'ve built several different means to delete items in Fintesk and to help address any situation.","permalink":"/kb/getting-started/how-can-i-delete-items-in-fintesk"},{"id":"kb/getting-started/how-is-fintesk-data-organized","title":"How is Fintesk data organized?","description":"Organizing your deals, contact persons, organizations, activities, products is essential to your sales process. Fintesk helps you organize all your items and link them together for better visibility.","permalink":"/"},{"id":"kb/getting-started/organization-vs-company-account","title":"Organization vs. company account","description":"When a Fintesk account is created, both a user account and a company account are created.","permalink":"/kb/getting-started/organization-vs-company-account"},{"id":"kb/getting-started/what-is-the-difference-between-a-user-and-a-seat","title":"What is the difference between a user and a seat?","description":"In Fintesk, your subscription is calculated by the number of seats you have in your account. An active (or invited) user will always take up one seat once they have been added to Fintesk, but it is possible to have empty seats if users have been deactivated or not added yet.","permalink":"/kb/getting-started/what-is-the-difference-between-a-user-and-a-seat"}],"unlisted":false}}')}}]);